function Sitemap(urls) {
console.log(urls);
    return (
        <div className="sitemap-urls">
            <table width="100%">
                <thead>
                    <tr>
                        <td>URLs</td>
                        <td>Change Frequency</td>
                    </tr>
                </thead>
                <tbody>
                    <TableRows urls="{urls}" />
                </tbody>
            </table>
        </div>
    );
}

function TableRows(data) {
    data.map((row) => (
        <tr>
            <td>{ data.loc }</td>
            <td>>{ data.changefreq }</td>
        </tr>
    ));
}



export default Sitemap;
